import React from 'react';
import Card from './card.component';
import { ListWrapper } from './styles';
// import { getLocalStorage } from '../../config/storage-manager';

const CardList = (cardsInfo: Array<string>, colIndex: number) => {
    return (
        <ListWrapper>
            {cardsInfo.map((card: string, index: number) => (
                <Card cardName={card} pos={colIndex} currentIndex={index}></Card>
                // return <Card cardName={card} pos={colIndex} />
            ))}
        </ListWrapper>
    );
}

export default CardList;
